import React from 'react'
import {makeStyle} from '@material-ui/core/styles'
import { FormControlLabel, ListItemButton, ListItemIcon, makeStyles } from '@mui/material';
import { CheckBox } from '@material-ui/icons';







const useStyles=makeStyles({
root:{'&$checked':{
color:"purple",
},
},
checked:{},
wrap:{width:'100%',
display:'flex',
flexDirection:'row-reverse',
justifyContent:'space-between',
alignItems:'center',
marginleft:0,
},
lebel:{
    fontSize:'.8rem',
    FontFamily:'Raleway' ,
}
});


const CheckedboxProton = ({age,changeChecked}) => {
    const classes=useStyles()
    const {checked,label,id}=age;
  return (
    <div>
        
        <ListItemButton sx={{ pl: 4 }}>
        <ListItemIcon>
      <FormControlLabel
classes={{
  label:classes.label,
  root:classes.wrap
}}
control={<CheckBox classes={{
  checked:classes.checked,
  root:classes.root
}} 
size="small" checked={checked} 
onChange={()=>changeChecked(id)}
color='secondary' 
 />
}
label={label}
/>
</ListItemIcon>
</ListItemButton>

</div>
    
  )
}

export default CheckedboxProton
